	add("homework", "{\"term\":\"homework\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|home|work|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Work that is done at home, especially school exercises set by a teacher\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d6|page\u003d30|magazine\u003d|title\u003d[http://www.theguardian.com/education/2013/jul/01/education-michael-gove-finland-gcse Finland spreads word on passage\u003dImagine a country where children do nothing but play until they start compulsory schooling at age seven. Then, without exception, they attend comprehensives until the age of 16.Children address teachers by their first names. Even 15-year-olds do no more than 30 minutes\u0027 \u0027\u0027homework\u0027\u0027 a night\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Preliminary or preparatory work, such as research\", \"priority\":3}]}, \"synonyms\":{}}");

	add("homicide", "{\"term\":\"homicide\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027homicide\u0027 from Latin {{m|la|homicīda||man-slayer}} and {{m|la|homicīdium||manslaughter}}. Equivalent to {{suffix||cide|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The killing of one person by another, whether premeditated or unintentional\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who kills another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A victim of homicide; a person who has been unlawfully killed by someone else\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, A J Holt, \u0027Watch Me\u0027 [http://print.google.com/print?id\u003dAeiWDMxtf70C\u0026amp;pg\u003dPA146\u0026amp;lpg\u003dPA146\u0026amp;sig\u003d58bpIF6WRwzfzHU-U8U9ZrEbME0\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“She was a hippie kid. How hard would you work a case like that\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"“As hard as anyone else,” said Goddard. There was an irritated note in his voice. “She was a \u0027\u0027homicide\u0027\u0027. She got what every \u0027\u0027homicide\u0027\u0027 investigation gets\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Ellen Perry Berkeley, \u0027Keith\u0027s People\u0027 (ISBN 1930859449), page 58\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"We don\u0027t even know the woman was a \u0027\u0027homicide\u0027\u0027. Didn\u0027t they say it was possible they both jumped\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Jon Talton, \u0027Dry Heat\u0027 (ISBN 0312333854), page 40\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The medical examiner was behind on autopsies and cranky, so we didn\u0027t even know if the old guy in the pool was a \u0027\u0027homicide\", \"priority\":10}]}, \"synonyms\":{}}");

	add("homicider", "{\"term\":\"homicider\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|homicide|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who commits homicide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homiletics", "{\"term\":\"homiletics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ὁμιλητική\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The art of preaching (especially the application of rhetoric in theology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homilite", "{\"term\":\"homilite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027-ite\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-prismatic mineral containing boron, calcium, iron, magnesium, oxygen, and silicon\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hommage", "{\"term\":\"hommage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027hommage\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A homage, especially something in an artwork which has been done in respectful imitation of another artist\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homoanhydride", "{\"term\":\"homoanhydride\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|anhydride|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An acid anhydride formed from two molecules of the same carboxylic acid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homocaust", "{\"term\":\"homocaust\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|homosexual|holocaust|lang\u003den}}. See {{m|en|Homocaust}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A systematic persecution of homosexuals, especially the one which occurred in Nazi Germany (the \u0027Homocaust\u0027), when seen as constituting systematic destruction of them\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Dagmar Herzog, \u0027Sexuality and German Fascism\u0027 (ISBN 1571815511), page 9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"However, the empirical basis for these arguments was established as early as 1977 by scholars who refuted the notion of a \u0026quot;\u0027\u0027homocaust\u0027\u0027,\u0026quot; an idea that had been awarded wide currency by German gay groups in the early 1970s\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Florence Tamagne, \u0027A history of homosexuality in Europe: Berlin, London, Paris, 1919-1939\u0027 (Algora Publishing, ISBN 9780875863559), page 397\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"To speak of a \u0026quot;final solution\u0026quot; or a \u0026quot;\u0027\u0027homocaust\u0027\u0027\u0026quot; for homosexuals is an absurdity that denigrates the homosexual cause\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, \u0027The Hidden Holocaust?\u0027 (ISBN 1134260989), page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Another view sometimes heard is that the Nazis\u0027 loudly trumpeted policy of \u0027eradicating\u0027 homosexuality amounted to a ‘\u0027\u0027homocaust\u0027\u0027’ somehow comparable to the extermination of the Jews\", \"priority\":7}]}, \"synonyms\":{}}");

	add("homocentrism", "{\"term\":\"homocentrism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|centrism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"anthropocentrism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homocerebrin", "{\"term\":\"homocerebrin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|cerebrin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A body similar to, or identical with, cerebrin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homochromia", "{\"term\":\"homochromia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|homo|chromia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use, by an organism, of the same colour as its background or other form of camouflage as a means of protection\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027, Jean Massart \u0026amp; Émile Vandervelde, \u0027Parasitism, Organic and Social\u0027 (trans. William Macdonald and J. Arthur Thomson), Swan Sonnenschein \u0026amp; Co. Limited (1895), [http://archive.org/stream/parasitismorgani00mas\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"page/16/ pages 16-17\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Lastly, the same holds good of mimetic parasitism; for at the climax of that process we have the elaborate imitation of the living organism, then of its cadaver or its excreta, till, finally, we arrive at \u0027\u0027homochromia\u0027\u0027, that is, the adoption by certain animals of the prevailing colour of their environment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, \u0027Animal Behaviour Abstracts\u0027, Volume 3, [http://books.google.com/books?id\u003dpiwYAQAAMAAJ\u0026amp;q\u003d%22homochromia%22\u0026amp;dq\u003d%22homochromia%22 page 201\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Mimetic \u0027\u0027homochromia\u0027\u0027 consists not only of imitation of the colour and texture of the environment or of other spp (animal or plant), but also involves Imitation of their behaviour, immobility being the best known example, especially in otherwise conspicuous spp\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Nancy Huston, \u0027Prodigy\u0027, McArthur \u0026amp; Company (2000), ISBN 1552781542, [http://books.google.com/books?id\u003dMZHzAAAAMAAJ\u0026amp;q\u003d%22homochromia%22 page 55\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I mean, butterflies are good at make-believe, too…. What are \u0027\u0027homochromia\u0027\u0027 and dissuasive livery, if not artistic lies? Like the \u0027Caligo prometheus\u0027, who proclaims to his enemies, \u0026quot;I\u0027m the head of an owl, I\u0027m gonna eat you!\u0026quot; Or the \u0027Samia cynthia\u0027, which looks like a dreadful dragon! Pride of our species, my eye.\u0026quot\", \"priority\":8}]}, \"synonyms\":{}}");

	add("homochromy", "{\"term\":\"homochromy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|homo|chromy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use, by an organism, of the same colour as its background as a means of protection\", \"priority\":1}]}, \"synonyms\":{\"list\":[{\"text\":\"homochromia\", \"synonymQualifier\":\"RARE\"}]}}");

	add("homocore", "{\"term\":\"homocore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|homo|core|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Queercore, an artistic and musical movement dealing with issues of sexual and gender prejudic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homocycle", "{\"term\":\"homocycle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|cycle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any inorganic compound based on a ring of three or more atoms of the same elemen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any organic derivative of such a compound\", \"priority\":2}]}, \"synonyms\":{}}");

	add("homodimer", "{\"term\":\"homodimer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|dimer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dimer derived from two identical monomers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homoeroticism", "{\"term\":\"homoeroticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|homoerotic|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being homoeroti\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"and the men-drained-of-maleness we often see in Cunningham\u0027s dances\", \"priority\":2}]}, \"synonyms\":{}}");

	add("homofascism", "{\"term\":\"homofascism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|fascism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political stance that associates fascism with homosexuality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Alison Guenther-Pal, \u0027Projecting Deviance/Seeing Queerly\u0027 (page 60\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Consequently, his position indirectly suggests that perverse societies produce perverse individuals, an ideological stance that very much mirrors a discourse that during the postwar period was primarily observed in literary circles: \u0027\u0027homofascism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Daniel Humphrey, \u0027Queer Bergman: Sexuality, Gender, and the European Art Cinema\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"At its worst, it [the art film] seems politically reactionary, tending toward \u0027\u0027homofascism\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Aggressive support for gay rights\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, \u0026quot;No One\u0026quot;, \u0027Re: GOD is sending homosexuals a message in California, \u0026quot;Mend your ways, or burn in HELL!\u0026quot;\u0027 (on newsgroup \u0027alt.politics.homosexuality\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Homofascism\u0027\u0027 is dedicated to the proposition that anyone who does not believe homosexuality is normal should be fired, disenfranchised, imprisoned, or \u0026quot;harried out of the land.\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0026quot;Democrats Destroy Society\u0026quot;, \u0027Re: Southern Poverty Law Center\u0027s Despicable Lies\u0027 (on newsgroup \u0027alt.religion.christian\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"If anything, Christians are guilty of standing idly and silently by as creeping \u0027\u0027homofascism\u0027\u0027 left its depraved bedroom and wormed its way into our public schools, our media, our television shows and Hollywood pictures, and even into our churches and the highest positions in our government and military\", \"priority\":10}]}, \"synonyms\":{}}");

	add("homogamy", "{\"term\":\"homogamy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|homo|gamy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"fertilization of a flower by pollen from the same plan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"breeding between similar individuals; inbreedin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"marriage or other union between similar people, or people of the same sex\", \"priority\":3}]}, \"synonyms\":{}}");

	add("homogenesis", "{\"term\":\"homogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A method of reproduction in which the parents and offspring are alike\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homogeny", "{\"term\":\"homogeny\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Similarity in structure, though of different function, because of genetic relationships\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homoglyph", "{\"term\":\"homoglyph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First attested in 1938; formed as {{prefix|homo|glyph|gloss1\u003dsame|lang\u003den}} after \u0027homograph\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A identical or nearly identical in to another, but which differs in the it represents\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027, w:Sylvanus Sylvanus Griswold Morley, \u0027The Inscriptions of w:Petén Petén\u0027 IV, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003do7QWAAAAYAAJ\u0026amp;q\u003d%22homoglyph%22\u0026amp;dq\u003d%22homoglyph%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dd94_T_iHMrSk0AWP8K2PDw\u0026amp;ved\u003d0CEcQ6AEwBA page 43]\u0026lt;/span\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The E variant of the moon sign may perhaps be regarded as a \u0027\u0027homoglyph\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, \u0027NIAS Report\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dzLPiAAAAMAAJ\u0026amp;q\u003d%22homoglyph%22+%22homoglyphs%22\u0026amp;dq\u003d%22homoglyph%22+%22homoglyphs%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWtY_T-6ZM8jL0QXR--WODw\u0026amp;ved\u003d0CDEQ6AEwAA page 34]\u0026lt;/span\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The lower case “L”, Upper case “i”, and Numeral “One” are \u0027\u0027homoglyphs\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Shinji Ido, \u0027Bukharan w:Tajik Tajik\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dKwRkAAAAMAAJ\u0026amp;q\u003d%22homoglyphs%22\u0026amp;dq\u003d%22homoglyphs%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dits_T-zDKsOq0QXnjLWPDw\u0026amp;ved\u003d0CEAQ6AEwAw page 4]\u0026lt;/span\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"All the other consonant phonemes are transcribed into the \u0027\u0027homoglyphs\u0027\u0027 of their IPA representations\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Theodore Rosendorf, \u0027The Typographic Desk Reference\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dWuIOAQAAMAAJ\u0026amp;q\u003d%22homoglyph%22+%22homoglyphs%22\u0026amp;dq\u003d%22homoglyph%22+%22homoglyphs%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWtY_T-6ZM8jL0QXR--WODw\u0026amp;ved\u003d0CDsQ6AEwAg page 50]\u0026lt;/span\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The pair shown is the letter \u0027f\u0027 and the guilder currency sign [ƒ]. \u0027\u0027Homoglyphs\u0027\u0027 can also occur within the same writing system\", \"priority\":9}]}, \"synonyms\":{}}");

	add("homograph", "{\"term\":\"homograph\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027\u0027 from Ancient greek (to 1453) \u0027ὁμός\u0027 (same) + \u0027\u0027 from Ancient greek (to 1453) \u0027γράφος\u0027 (that which is written)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word that is spelled the same as another word, usually having a different etymology, such as \u0026quot;bear\u0026quot;, the animal, and \u0026quot;bear\u0026quot;, to support, to tolerate, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homography", "{\"term\":\"homography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|homo|graphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being spelt homographically; the state or quality of existing as homographs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An invertible transformation from a projective space to itself that maps straight lines to straight lines\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027homography\u0027\u0027 on a real projective plane can be specified by a mapping from one set of four non-collinear points to another set of four non-collinear points. Given such a specification, then the 3-by-3 \u0027\u0027homography\u0027\u0027 matrix may be computed by means of the DLT (Direct Linear Transformation) algorithm\", \"priority\":3}]}, \"synonyms\":{}}");

	add("homoiconicity", "{\"term\":\"homoiconicity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A property of some programming languages, in which the primary representation of programs is also a data structure in a primitive type of the language itself\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homoiousia", "{\"term\":\"homoiousia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The doctrine of the homoiousians\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homolog", "{\"term\":\"homolog\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{borrowing|fr|homologue|lang\u003den}}, From Ancient greek (to 1453) {{m|grc|ὁμόλογος||agreeing, of one mind}}, equivalent to {{suffix|homo|log|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something homologous; a homologous organ or part, chemical compound or a chromosome\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A word shared by two languages or dialects\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One of a group of similar DNA sequences that share a common ancestry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A member of a homologous series\", \"priority\":4}]}, \"synonyms\":{}}");

	add("homomorphism", "{\"term\":\"homomorphism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|morphism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A structure-preserving map between two algebraic structures, such as groups, rings, or vector spaces\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A field \u0027\u0027homomorphism\u0027\u0027 is a map from one field to another one which is additive, multiplicative, zero-preserving, and unit-preserving\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A similar appearance of two unrelated organisms or structures\", \"priority\":3}]}, \"synonyms\":{}}");

	add("homomultimer", "{\"term\":\"homomultimer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|multimer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A multimeric protein consisting of two or more identical components\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homonationalism", "{\"term\":\"homonationalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|nationalism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The favourable association of gay and lesbian people and/or gay rights with a nationalist ideology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homonym", "{\"term\":\"homonym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|homo|onym|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word that both sounds and is spelled the same as another word but has a different meaning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A word that sounds or is spelled the same as another word but has a different meaning, technically called a (same sound) or a (same spelling\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A name for a taxon that is identical in spelling to another name that belongs to a different taxon\", \"priority\":3}]}, \"synonyms\":{}}");

	add("homooligomer", "{\"term\":\"homooligomer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|homo|oligomer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any oligomer, all of whose monomers are the same\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homophone", "{\"term\":\"homophone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|homo|phone|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word which is pronounced the same as another word but differs in spelling \u0027or\u0027 meaning \u0027or\u0027 origin, for example: carat, caret, carrot, and karat.\u0026lt;ref\u0026gt;http://www.merriam-webster.com/dictionary/homophone\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;http://www.askoxford.com/concise_oed/homophone?view\u003duk\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A letter or group of letters which are pronounced the same as another letter or group of letters\", \"priority\":2}]}, \"synonyms\":{}}");

	add("homophony", "{\"term\":\"homophony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|homo|phony|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a texture in which two or more parts move together in harmony, the relationship between them creating chords\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The quality of being homophonous\", \"priority\":2}]}, \"synonyms\":{}}");

	add("homoplasmy", "{\"term\":\"homoplasmy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|homo|plasmy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the presence of the same mutation in all copies of mitochondrial or plastid DNA within a single cell or individual\", \"priority\":1}]}, \"synonyms\":{}}");

