	add("homoromanticism", "{\"term\":\"homoromanticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|homoromantic|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being being romantically attracted to the same gender\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Arthur Lipkin, \u0026quot;The Case for a Gay and Lesbian Curriculum\u0026quot;, \u0027The High School Journal\u0027, Volume 77, Number 1/2, October/November 1993 - December 1993/January 1994, [https://books.google.com/books?id\u003dcAdPAQAAIAAJ\u0026amp;q\u003d%22homoromanticism%22 page 103\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For example, analysis of Thoreau\u0027s poem “Sympathy” (“Lately, alas, I knew a gentle boy\u0026quot;) is enriched by considering its \u0027\u0027homoromanticism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Louisa Ellen Stein, \u0026quot;[http://cinema.usc.edu/assets/097/15728.pdf \u0027They Cavort, You Decide\u0027: Transgenericism, Queerness, and Fan Interpretation in Teen TV]\u0026quot;, \u0027Spectator\u0027, Volume 25, Issue 1, Spring 2005, page 21\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In \u0027Smallville\u0027’s teen fantasy, the themes of alienation and the search for identity easily transmute into \u0027\u0027homoromanticism\u0027\u0027 and sympathetic queerness\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0026quot;[http://www.straight.com/blogra/homoromanticism-sufjan-stevens-little-ditties The \u0027\u0027homoromanticism\u0027\u0027 of Sufjan Stevens\u0027 little ditties]\u0026quot;, \u0027The Georgia Straight\u0027, 2 December 2006 (used in title only\", \"priority\":6}]}, \"synonyms\":{}}");

	add("homosexism", "{\"term\":\"homosexism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Homophobia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, G L Hansen, \u0027Measuring prejudice against homosexuality (\u0027\u0027homosexism\u0027\u0027) among college students \u0026amp;mdash; a new scale\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Walter Samuel Hunter, \u0027Psychological abstracts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Examined the relationship between \u0027\u0027homosexism\u0027\u0027 (homophobia\", \"priority\":4}]}, \"synonyms\":{}}");

	add("homosexualist", "{\"term\":\"homosexualist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|homosexual|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, w:George Kingsley George Kingsley Zipf, \u0027Human Behavior and the Principle of Least Effort\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"roughly speaking, a \u0027\u0027homosexualist\u0027\u0027 is born and not made\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Michael Denneny, Charles Ortleb, Thomas Steele, \u0027The Christopher Street reader\u0027 (page 297\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They have got fairly liberal laws on victimless crimes, but the Los Angeles police are still busy entrapping \u0027\u0027homosexualists\u0027\u0027 because the police chief in Los Angeles is very antifag\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, F. Earle Fox and David W. Virtue, \u0027Homosexuality: Good and Right in the Eyes of God\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"and how the \u0027\u0027homosexualist\u0027\u0027 cause is rooted squarely in the secular/pagan view of the cosmos\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Linda Alcoff, Linda Martín Alcoff and Eduardo Mendieta, \u0027Identities: Race, Class, Gender, and Nationality\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Fundamentally, unconsciously, I believe he\u0027s a \u0027\u0027homosexualist\", \"priority\":8}]}, \"synonyms\":{}}");

	add("homosexuality", "{\"term\":\"homosexuality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|homosexual|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being sexually and romantically attracted primarily or exclusively to persons of the same sex\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sexual activity with a person of the same sex\", \"priority\":2}]}, \"synonyms\":{\"list\":[{\"text\":\"uranism\", \"synonymQualifier\":\"RARE\"}]}}");

	add("homosexualness", "{\"term\":\"homosexualness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|homosexual|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being homosexual\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homosociality", "{\"term\":\"homosociality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|sociality|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Socialization (social interaction, social relationships) with members of the same sex, as distinguished from sexual interaction with or attraction to members of the same sex (homosexuality) and social interaction with members of the opposite sex (heterosociality\", \"priority\":1}]}, \"synonyms\":{}}");

	add("homospore", "{\"term\":\"homospore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|homo|spore|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any plant producing spores of the same size and type\", \"priority\":1}]}, \"synonyms\":{}}");

